import React from 'react';
import { Routes ,Route } from 'react-router-dom';
import Login from './Login';
import Register from './Register';

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/login" element={Login} />
          <Route path="/register" element={Register} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
